import React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Title from '../Title/Title';
import * as actions from '../../../store/actions/index';
import {connect} from 'react-redux';

const useStyles = makeStyles((theme) => ({
  seeMore: {
    marginTop: theme.spacing(3),
  },
}));

function PreviousResults(props) {
  const classes = useStyles();
  return (
    <React.Fragment>
      <Title>Previous Results</Title>
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell>Date</TableCell>
            <TableCell>Case Numbers</TableCell>
            <TableCell>Winner</TableCell>
            <TableCell>Winning Guess</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {props.results.slice(1).map((row) => (
            <TableRow key={row.date}>
              <TableCell>{row.date}</TableCell>
              <TableCell>{row.caseNumbers}</TableCell>
              <TableCell>{row.winner}</TableCell>
              <TableCell>{row.winningGuess}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </React.Fragment>
  );
}

const mapStateToProps = state => {
  return {
      results: state.guess.results
  }
}

const mapDispatchToProps = dispatch => {
  return {
      fetchResults: (numResultsToFetch) => dispatch(actions.fetchResults(numResultsToFetch))  }
}

export default connect(mapStateToProps, mapDispatchToProps)(PreviousResults);
